import React, { Component } from 'react'
// import Listitem from './Listem'

export default class List extends Component {
  componentDidMount(){
    setTimeout(() => {
    console.log(this.props.users);
      
    }, 2000);
  }
  render() {
    return (
      <div className="row">
        {
          this.props.users.map((a) => {

            return (
              <div className="card"  >
            <a href={a.avatar_url} target="_blank" >
              <img src={a.html_url} style={{ width: '100px' }} />
            </a>
            <p className="card-text">{a.login}</p>
          </div>
            )
            // <Listitem key={a.id} users={this.props.users} />

          })

        }
      </div>
    )
  }
}
